import React from "react";
// import { Layout } from "antd";
import { Layout, Avatar, Menu, Button, Row, Col, Carousel, Icon } from "antd";

export default function Header() {
  return (
    <div>
      <Header>
        <div className="logo">
          <img style={{ borderRadius: "4px" }} src="./images/logo2.jpeg" />
        </div>
        <Menu
          style={{
            float: "right",
            backgroundColor: "transparent !important",
            color: "#d8d8d8",
          }}
          mode="horizontal"
          defaultSelectedKeys={["1"]}
        >
          <Menu.Item key="1" className="customclass">
            Home
          </Menu.Item>
          <Menu.Item key="2" className="customclass">
            OUR FOOD
          </Menu.Item>
          <Menu.Item key="3" className="customclass">
            PLANS
          </Menu.Item>
          <Menu.Item>
            <Button
              style={{
                borderRadius: "12px",
                backgroundColor: "#74cf4e",
                color: "white",
              }}
              // type="sucess"
              // icon={<DownloadOutlined />}
            >
              Signup / login
            </Button>
          </Menu.Item>
        </Menu>
      </Header>{" "}
      <Header>
        <div className="logo">
          <img style={{ borderRadius: "4px" }} src="./images/logo2.jpeg" />
        </div>
        <Menu
          style={{
            float: "right",
            backgroundColor: "transparent !important",
            color: "#d8d8d8",
          }}
          mode="horizontal"
          defaultSelectedKeys={["1"]}
        >
          <Menu.Item key="1" className="customclass">
            Home
          </Menu.Item>
          <Menu.Item key="2" className="customclass">
            OUR FOOD
          </Menu.Item>
          <Menu.Item key="3" className="customclass">
            PLANS
          </Menu.Item>
          <Menu.Item>
            <Button
              style={{
                borderRadius: "12px",
                backgroundColor: "#74cf4e",
                color: "white",
              }}
              // type="sucess"
              // icon={<DownloadOutlined />}
            >
              Signup / login
            </Button>
          </Menu.Item>
        </Menu>
      </Header>
    </div>
  );
}
